Sa diagram, dalawang bilog, bawat isa ay may sentro sa $D$, ay may mga radius na $1$ at $2$. Ang kabuuang lugar ng may lilim na bahagi ay $\frac5{12}$ ng lugar ng mas malaking bilog. Ilang degree ang sukat ng (mas maliit na) $\angle ADC$?
